import {
  Checkbox,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
} from "@material-ui/core";
import react from "react";
import { useDispatch, useSelector } from "react-redux";
import { tableDataLoadStart } from "./action";
import LinkIcon from "@mui/icons-material/Link";
import homePageStyles from "./styles";
import { GitHub } from "@mui/icons-material";
const HomePage = () => {
  const classes = homePageStyles();
  const dispatch = useDispatch();

  react.useEffect(() => {
    dispatch(tableDataLoadStart());
  }, []);

  const storeState = useSelector((state) => {
    return state.tableDataReducer;
  });
  const { data } = storeState.data;

  const capitalize = (str, lower = false) =>
    (lower ? str.toLowerCase() : str).replace(/(?:^|\s|["'([{])+\S/g, (match) =>
      match.toUpperCase()
    );
  return data ? (
    <Paper className={classes.root}>
      <Table stickyHeader>
        <TableHead>
          <TableRow>
            <TableCell classes={{ root: classes.tableCellHeader }}>
              <GitHub />
            </TableCell>
            {Object.keys(data[0])
              .slice(1)
              .map((key) => {
                return (
                  <TableCell classes={{ root: classes.tableCellHeader }}>
                    {capitalize(key.slice(0, key.indexOf("n") + 1)) +
                      " " +
                      capitalize(key.slice(key.indexOf("n") + 1, key.length))}
                  </TableCell>
                );
              })}
          </TableRow>
        </TableHead>
        <TableBody
          classes={{
            root: classes.tableBody,
          }}
        >
          {data.map((key) => {
            return (
              <TableRow key={key.id}>
                <TableCell classes={{ root: classes.tableCell }}>
                  <Checkbox />
                </TableCell>
                {Object.values(key)
                  .slice(1)
                  .map((value) => {
                    return (
                      <TableCell classes={{ root: classes.tableCell }}>
                        {value.includes("https") ? (
                          <a href={value}>
                            <LinkIcon />
                          </a>
                        ) : (
                          capitalize(value)
                        )}
                      </TableCell>
                    );
                  })}
              </TableRow>
            );
          })}
        </TableBody>
      </Table>
    </Paper>
  ) : (
    <h1>Nothing</h1>
  );
};
export default HomePage;
